const myMap = new Map([
    ['apai4159', '#StriveToThrive'],
    ['', 'value2'],
  ]);

export default function Passwords(){

    return (
        <>
            <h1 style={{textAlign: "center"}}>Welcome to Fakyak!</h1>
            <h2 style={{textAlign: "center"}}><i>Please enter your username and password:</i></h2>
            <div style={{alignItems: "center", paddingTop: 100}}>
                <label>Username: </label>
                <input type="text" id="user" name="user"/>
                <br/>
                <br/>
                <label>Password: </label>
                <input type="text" id="pass" name="pass"/>
                <br/>
                <br/>
                <br/>
                <button onClick={isLoggedIn}>SUBMIT</button>
            </div>

        </>
    )
}

function isLoggedIn(){
    console.log("Yay! You pressed me")
    return 0;
}
